import React from "react";
import { useParams } from "react-router-dom";

const DetailJob = () => {
  let { id } = useParams();
  let { company } = useParams();
  return (
    <h3>
      ID: {id}
      company name : {company}
    </h3>
  );
};

export default DetailJob;
